from typing import List


class Solution:
    def strStr(self, haystack: str, needle: str) -> int:
        if needle == "":
            return 0

        haystack_runner = 0
        while haystack_runner < len(haystack):
            if haystack[haystack_runner:].startswith(needle):
                return haystack_runner
            haystack_runner += 1
        return -1




def verbose_assert(*args):
    output = Solution().strStr(*args)
    print("Input:  %s\nOutput: %s" % (args, output))


if __name__ == '__main__':
    args = ("a", "a")
    haystack = ""
    needle = ""
    verbose_assert(haystack, needle)